import { Link } from "react-router-dom";
import React from "react";
import './header.scss'
import Search from '@material-ui/icons/Search';
import ShoppingCartOutlined from '@material-ui/icons/ShoppingCartOutlined';
import PersonOutline from '@material-ui/icons/PersonOutline';
import { IconButton } from '@material-ui/core';
import { useHistory } from 'react-router-dom';



const Header = () => {

    const history = useHistory();

    return (

        <div className='navbar fixed-nav'>
            <div className='wrapper'>
            <div className='left'>
            <div className='item'>
                    <Link className='links' to='/'>Home</Link>
                </div>
                <div className='item'>
                    <Link className='links' to='/products'>Store</Link>
                </div>
                <div className='item'>
                    <Link className='links' to='/contact'>Contact</Link>
                </div>
                <div className='item'>
                    <Link className='links' to='/about'>About</Link>
                </div>


            </div>
            <div className='center'>
            <div className='item'>
                <Link className='links' to='/'>TAYLORGOODS</Link>
                </div>
            </div>

            <div className='right'>
                <div className='icons'>
                    <IconButton onClick={() => history.push('/search')}><Search /></IconButton>
                    <IconButton onClick={() => history.push('/some-route')}><PersonOutline /></IconButton>
                    <IconButton>
                    <div className='cartIcon'>
                    <ShoppingCartOutlined />
                        <span>0</span>
                    </div>
                    </IconButton>
                </div>
            </div>
            </div>
        </div>

    );
};

export default Header;
